import React, { Component } from "react";

export default class Card extends Component {
  render() {
    return (
      <div>
        <svg style={{ width: "400", height: "110" }}>
          <rect
            style={{
              width: "300",
              height: "100",
              style: "fill:rgb(0,0,255);stroke-width:3;stroke:rgb(0,0,0)"
            }}
          />
        </svg>
        {this.props.title}
      </div>
    );
  }
}
